import React, { Component } from "react";
import ArrowDownwardOutlinedIcon from "@mui/icons-material/ArrowDownwardOutlined";
import "./TrangChu.css";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
export default class TrangChu extends Component {
  render() {
    const data = [
      {
        name: "month 1",
        uv: 4000,
        pv: 2400,
        amt: 2400,
      },
      {
        name: "month 2",
        uv: 3000,
        pv: 1398,
        amt: 2210,
      },
      {
        name: "month 3",
        uv: 3000,
        pv: 9800,
        amt: 2290,
      },
      {
        name: "month 4",
        uv: 5000,
        pv: 2800,
        amt: 2290,
      },
      {
        name: "month 5",
        uv: 3000,
        pv: 2800,
        amt: 2290,
      },
      {
        name: "month 6",
        uv: 1000,
        pv: 100,
        amt: 2290,
      },
      {
        name: "month 7",
        uv: 2000,
        pv: 9800,
        amt: 2290,
      },
      {
        name: "month 8",
        uv: 2100,
        pv: 900,
        amt: 2290,
      },
      {
        name: "month 9",
        uv: 20,
        pv: 9000,
        amt: 2290,
      },
    ];
    return (
      <>
        <div className="container">
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon
                style={{ color: "red" }}
              ></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon
                style={{ color: "red" }}
              ></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
          <div className="tb">
            <h3>Revanua</h3>
            <div className="down">
              <span>1233$ - 2323$</span>
              <ArrowDownwardOutlinedIcon
                style={{ color: "red" }}
              ></ArrowDownwardOutlinedIcon>
            </div>
            <h3>Compared to last month</h3>
          </div>
        </div>
        <div className="chart">
         
        </div>
      </>
    );
  }
}
